import React from 'react';
import SquareButton from './SquareButton'
import './App.css';
import Selector from "./selector"


function App() {

  let position = 0;

  let squareOne;
  let squareTwo;
  let squareThree;
  let squareFour;

  return(
    <div id = "overAll">
      <div id = "contentA">
        <div id = "buttonBlock">
          {squareOne = <SquareButton color="goldenrod"></SquareButton>}
          {squareTwo = <SquareButton color="red"></SquareButton>}
          {squareThree = <SquareButton color= "slategrey"></SquareButton>}
          {squareFour = <SquareButton color = "darkcyan"></SquareButton>}
        </div>
      </div>
      <div id = "contentB">
        <div id = "selectorblock">
          < Selector position = {position}>  </Selector>
        </div>
      </div>
  </div>
  );
}

export default App;
